import React from "react";
import {
  InboxOutlined,
  PictureOutlined,
  UsergroupAddOutlined,
  UserAddOutlined,
  BellOutlined,
  LinkedinOutlined,
  ToolOutlined,
  QuestionOutlined,
} from "@ant-design/icons";
import monday from "../Images/monday.png";
const Header = () => {
  return (
    <nav class="navbar navbar-light bg-light">
      <div class="container-fluid">
        <span class="navbar-brand mb-0 h1">
            <img src={monday} className="monday"/>
          <p className="text-style"><b>monday</b> <i><b>workflow management</b></i></p>
        </span>
        <span className="notifyStyle">
          <BellOutlined  className="notification" />
          <LinkedinOutlined className="linkedOutlined"/>
          <QuestionOutlined className="questionLined"/>
          <InboxOutlined  className="inboxOutlined"/>
          <PictureOutlined className="pictureOutline"/>
          <UsergroupAddOutlined className="userGroup"/>
          <ToolOutlined className="toolOut"/>
          <UserAddOutlined className="userAdd"/>
        </span>
      </div>
    </nav>
  );
};

